package cn.npnt.tiaps.vo;import java.util.Date;public class TrendVO {	public TrendVO(){			}	public TrendVO(long id,String title){		this.id = id;		this.title = title;	}		private long id;	private Integer version;	private Boolean deleted;	private String title;	private Date createTime;		public long getId() {		return id;	}	public void setId(long id) {		this.id = id;	}	public Integer getVersion() {		return version;	}	public void setVersion(Integer version) {		this.version = version;	}	public Boolean getDeleted() {		return deleted;	}	public void setDeleted(Boolean deleted) {		this.deleted = deleted;	}	public String getTitle() {		return title;	}	public void setTitle(String title) {		this.title = title;	}	public Date getCreateTime() {		return createTime;	}	public void setCreateTime(Date createTime) {		this.createTime = createTime;	}}